class Solution:
    def findMaximumNumber(self, k: int, x: int) -> int:
        def count_bits(num):
            count = 0
            while num:
                count += num & 1
                num >>= 1
            return count

        def calculate_sum(num):
            sum = 0
            for i in range(1, num + 1):
                binary_repr = format(i, 'b')
                for j in range(len(binary_repr)):
                    if binary_repr[-(j + 1)] == '1' and (j + 1) % x == 0:
                        sum += 1
            return sum

        low, high = 1, 2
        while calculate_sum(high) <= k:
            low = high
            high *= 2

        while low < high:
            mid = low + (high - low) // 2
            if calculate_sum(mid) <= k:
                if calculate_sum(mid + 1) > k:
                    return mid
                low = mid + 1
            else:
                high = mid
        return low
